import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

const API_BASE_URL = 'http://localhost:8000/api';

function App() {
  const [items, setItems] = useState([]);
  const [newItem, setNewItem] = useState({ title: '', details: '' });
  const [editingItem, setEditingItem] = useState(null);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    fetchItems();
  }, []);

  const fetchItems = async () => {
    setLoading(true);
    try {
      const response = await axios.get(`${API_BASE_URL}/items/`);
      setItems(response.data);
    } catch (error) {
      console.error('Error fetching items:', error);
    } finally {
      setLoading(false);
    }
  };

  const createItem = async () => {
    if (!newItem.title.trim()) return;
    try {
      const response = await axios.post(`${API_BASE_URL}/items/`, newItem);
      setItems([response.data, ...items]);
      setNewItem({ title: '', details: '' });
    } catch (error) {
      console.error('Error creating item:', error);
    }
  };

  const updateItem = async (id, updatedItem) => {
    try {
      const response = await axios.put(`${API_BASE_URL}/items/${id}/`, updatedItem);
      setItems(items.map(item => item.id === id ? response.data : item));
      setEditingItem(null);
    } catch (error) {
      console.error('Error updating item:', error);
    }
  };

  const deleteItem = async (id) => {
    try {
      await axios.delete(`${API_BASE_URL}/items/${id}/`);
      setItems(items.filter(item => item.id !== id));
    } catch (error) {
      console.error('Error deleting item:', error);
    }
  };

  const toggleStatus = async (id, currentStatus) => {
    const newStatus = currentStatus === 'pending' ? 'completed' : 'pending';
    try {
      const response = await axios.post(`${API_BASE_URL}/items/${id}/toggle/`, { status: newStatus });
      setItems(items.map(item => item.id === id ? response.data : item));
    } catch (error) {
      console.error('Error toggling status:', error);
    }
  };

  const handleEdit = (item) => {
    setEditingItem(item);
  };

  const handleSaveEdit = () => {
    if (editingItem) {
      updateItem(editingItem.id, editingItem);
    }
  };

  const handleCancelEdit = () => {
    setEditingItem(null);
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Preflight Checklist</h1>
      </header>
      <main className="App-main">
        <div className="add-item">
          <input
            type="text"
            placeholder="Item title"
            value={newItem.title}
            onChange={(e) => setNewItem({ ...newItem, title: e.target.value })}
          />
          <textarea
            placeholder="Details (optional)"
            value={newItem.details}
            onChange={(e) => setNewItem({ ...newItem, details: e.target.value })}
          />
          <button onClick={createItem}>Add Item</button>
        </div>
        {loading ? (
          <p>Loading...</p>
        ) : (
          <ul className="item-list">
            {items.map(item => (
              <li key={item.id} className={`item ${item.status}`}>
                {editingItem && editingItem.id === item.id ? (
                  <div className="edit-form">
                    <input
                      type="text"
                      value={editingItem.title}
                      onChange={(e) => setEditingItem({ ...editingItem, title: e.target.value })}
                    />
                    <textarea
                      value={editingItem.details}
                      onChange={(e) => setEditingItem({ ...editingItem, details: e.target.value })}
                    />
                    <button onClick={handleSaveEdit}>Save</button>
                    <button onClick={handleCancelEdit}>Cancel</button>
                  </div>
                ) : (
                  <div className="item-content">
                    <h3>{item.title}</h3>
                    {item.details && <p>{item.details}</p>}
                    <p>Status: {item.status}</p>
                    <div className="item-actions">
                      <button onClick={() => toggleStatus(item.id, item.status)}>
                        {item.status === 'pending' ? 'Mark Complete' : 'Mark Pending'}
                      </button>
                      <button onClick={() => handleEdit(item)}>Edit</button>
                      <button onClick={() => deleteItem(item.id)}>Delete</button>
                    </div>
                  </div>
                )}
              </li>
            ))}
          </ul>
        )}
      </main>
    </div>
  );
}

export default App;
